import React from "react";
import List from "../models/List.js"
export default class Results extends React.Component {
    constructor(props) {
        super(props)
        console.log("in results");
        console.log(props.setResults());
        this.state = {
            data:props.setResults()
        }
        console.log(this.state.data);

    }

    render() {
        return(
            <div className="Search">
                <div className="col-lg-12">
                    <div class="card text-white bg-dark text-center">
                        <ul class="list-group list-group-flush">
                            {this.state.data.results && <li class="list-group-item"><label>Search Results:</label>{this.state.data.results}</li>}
                            {this.state.data.state && <li class="list-group-item"><label>State:</label>{this.state.data.state}</li>}
                            {this.state.data.date && <li class="list-group-item"><label>Date:</label>{this.state.data.date}</li>}
                            {this.state.data.cases && <li class="list-group-item"><label>Cases:</label>{this.state.data.cases}</li>}
                            {this.state.data.deaths && <li class="list-group-item"><label>Deaths:</label>{this.state.data.deaths}</li>}
                        </ul>
                    </div>
                </div>
                <div className="col-lg-12">
                    {this.state.data.list[0].state}
                </div>
            </div>
        )
    }
}
